import React from "react";

const Experience = () => {
  return (
    <div className="experience">
      <div className="achievement">
        <div className="circle">7+</div>
        <span>years</span>
        <span>Experience</span>
      </div>
      <div className="achievement">
        <div className="circle">20+</div>
        <span>completed</span>
        <span>Projects</span>
      </div>
      <div className="achievement">
        <div className="circle">5+</div>
        <span>companies</span>
      </div>
    </div>
  );
};

export default Experience;
